buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>109 spotkanie WJUG</h4>\n            <h2>Rozmowy kwalifikacyjne i jak się przebić</h2>\n            <h3><a href="http://www.kubrynski.com" target="_blank"> Jakub Kubryński</a>,<a href="http://blog.solidcraft.eu" target="_blank"> Jakub Nabrdalik</a>,<a href="http://szimano.org/" target="_blank"> Tomasz Szymański</a></h3>\n            <p>Termin: 26.02.2013 godz. 18:00</p>\n            <p>Lokalizacja: MIMUW, sala 3180</p>\n            <p>Zapisy i dyskusja</p>\n            <ul>\n              <li> <a href="http://www.meetup.com/Warszawa-Java-User-Group-Warszawa-JUG/events/103469732/" target="_blank"> Meetup</a></li>\n              <li> <a href="https://groups.google.com/forum/#!topic/warszawa-jug/r60_oLj_psY" target="_blank"> grupa</a></li>\n            </ul>\n            <h3>O prezentacji:</h3>\n            <p>Tym razem całe spotkanie będzie poświęcone rekrutacji. </p>\n            <p>Cel jest prosty: zwiększyć szanse WJUGowiczów podczas rekrutacji i zapewnić maksymalną do umiejętności, płacę startową. </p>\n            <p>Cel drugorzędny: zmniejszyć ryzyko firmy zatrudniającej. </p>\n            <p>Bo wbrew pozorom, dobra firma chce zapłacić człowiekowi jak najwięcej, ale musi mieć po temu powody. </p>\n            <p>Spotkanie poprowadzi kilku specjalistów z firm IT, zajmujących się (także) rekrutowaniem. </p>\n            <ul>\n              <li>Jakub Kubryński, Kierownik Zespołu Rozwoju Oprogramowania, PayU S.A. </li>\n              <li>Tomasz Szymański, CEO, SoftwareMill</li>\n              <li>Jakub Nabrdalik, Solution Architect, TouK </li>\n              <li>i być może jeszcze jeden niespodziankowy gość. </li>\n            </ul>\n            <p>Opowiedzą o tym, jak często wygląda ten proces z obu zainteresowanych stron, co sprawia kandydatom największe problemy podczas rekrutacji, jak  rozmawiać o pieniądzach, jakie błędy są często popełniane i przede wszystkim: </p>\n            <p>JAK SIĘ PRZYGOTOWAĆ, by pracę zdobyć </p>\n            <p>Będzie też trochę o tym, jak w ogóle pokierować swoją karierą. </p>\n            <p>Spotkanie z założenia nie wymaga żadnej wiedzy, jest skierowane zarówno  dla studentów którzy dopiero będą szukać pracy, jak i starych wyjadaczy,  którzy myślą o zmianie firmy, ale ciężko im znaleźć kogoś, kto zaproponuje podobnie niebotyczną kwotę. </p>\n            <p>Jest to dobry pomysł także dla osób, które zaczynają swoją przygodę w  roli rekrutera - może poświęcenie chwili dzisiaj pozwoli uniknąć popełniania błędów w przyszłości. </p>\n            <p>Jeśli macie jakiś znajomych, którzy szukają lub będą szukać pracy w firmach software’owych, dajcie im znać. Dajcie znać zwłaszcza tym, którzy stoją na początku swojej kariery, lub na rozdrożu, i muszą podejmować ciężkie decyzje. Będziemy rozmawiać o doświadczeniach z obu stron lustra. </p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
