buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>114 spotkanie WJUG</h4>\n            <h2>Redis, Riak, MongoDB - 3 smaki NoSQL</h2>\n            <h3>Jakub Narbdalik, Paweł Cesar Sanjuan Szklarz, Paweł Sidoryk</h3>\n            <p>Termin: 7.05.2013 godz. 18:00</p>\n            <p>Lokalizacja: MIMUW, sala 3180</p>\n            <p>Sponsor:<a href="http://pl.adpilot.com/" target="_blank"> AdPilot</a></p>\n            <p>Zapisy i dyskusja</p>\n            <ul> \n              <li> <a href="http://www.meetup.com/Warszawa-Java-User-Group-Warszawa-JUG/" target="_blank"> Meetup</a></li>\n              <li> <a href="https://groups.google.com/forum/#!topic/warszawa-jug/OQtouw4D_50" target="_blank"> grupa</a></li>\n              <li> <a href="https://docs.google.com/file/d/0B8d787eZJXI_YlNSZmdJcERrSkE/edit?usp=sharing" target="_blank"> plakat</a></li>\n            </ul>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/r3wIYOggWmU" frameborder="0" allowfullscreen></iframe></p>\n            <h3>Temat pierwszy: RIAK</h3>\n            <p>Riak jest skalowalną oraz odporną na awarie rozproszoną bazą danych. Jest rozwijany jako projekt open source. Riak oferuje wiele cennych i unikalnych funkcji:</p>\n            <ul> \n              <li>jest stworzony do pracy w rozproszonych środowiskach (również w chmurze)</li>\n              <li>działa na zasadzie równorzędnych węzłów i nie występuje w nim problem "single point of failure"</li>\n              <li>jest odporny na awarie nawet wielu węzłów jednocześnie, gwarantuje że nigdy nie utracimy naszych danych</li>\n              <li>oferuje wysoką dostępność danych w aplikacjach wymagających bardzo dużego poziomu odczytu i zapisu danych</li>\n              <li>skaluje się w prosty i inteligentny sposób , bez przerywania pracy systemu</li>\n              <li>jest  bardzo stabilny, świetnie sprawdza się jako fundament infrastruktury chmurowej </li>\n              <li>oferuje funkcje MapReduce, wbudowane rozproszone wyszukiwanie pełnotekstowe</li>\n            </ul>\n            <p>W trakcie wykładu będą zaprezentowane następujące rzeczy:</p>\n            <ul>\n              <li>klaster zbudowany na bazie kilku komputerów Raspberry PI. Będziemy np. próbowali "zepsuć" taki klaster wyciągając wtyczki LAN</li>\n              <li>lokalne środowisko deweloperskie z 4 węzłami</li>\n              <li>wprowadzenie do podstawowych funkcji Riak-a: mechanizm replikacji, wybór trybu spójności, indeksy pomocnicze, MapReduce, wyszukiwanie pełnotekstowe</li>\n              <li>obsługa współbieżności operacji na danych za pomocą mechanizmu zegara logicznego ("vector clock")</li>\n              <li>komunikacja z bazą Riak za pomocą wywołań REST</li>\n              <li>komunikacja z bazą Riak z poziomu Javy</li>\n              <li>zalecany model danych</li>\n              <li>wady Riak-a (jest ich bardzo mało)</li>\n            </ul>\n            <h3>O prelegencie: Paweł Sidoryk</h3>\n            <p>Paweł Sidoryk od 15 lat zawodowo zajmuje się rozwojem oprogramowania jako architekt, lider techniczny oraz programista. Lubi łączyć teorię z praktyką. Obecnie interesuje się systemami rozproszonymi (głównie Riak) oraz matematycznym modelowaniem systemów (z użyciem języka Alloy).</p>\n            <h3>Temat drugi: Redis</h3>\n            <p>Redis to bardzo prosta baza w pamięci zainspirowana przez memcache. Do struktury klucz-> wartość nakłada dodatkowe struktury danych i operacje atomowe na nich. Pokażę jak mechanizmy transakcji i atomowość pomagają przekładać ciężar niektórych algorytmów do Redisa.</p>\n            <h3>O prelegencie: Paweł Cesar Sanjuan Szklarz</h3>\n            <p>Matematyk, 8 lat doświadczenie jako programista/architekt. Praca głównie w javie, ale coraz częściej Scala i node.js (javascript). Mocna angażowany w działaniu Warszawa Java User Group (WJUG). Specjalizuję się w implementacji architektur usługowych i wdrażam własny pomysł na realizacji injektowania zdalnego. Mąż, Ojciec, Polak-Meksykanin. </p>\n            <h3>Temat trzeci: MongoDB</h3>\n            <p>MongoDB jest najpopularniejszą NoSQLową bazą danych. Prawdopodobnie głównie dlatego, że posiada większość mechanizmów do których przyzwyczailiśmy się w relacyjnych bazach danych (ad hoc queries, secondary indexes, atomowość), a jednocześnie daje wiele, których próżno szukać w RDBMSach (automatyczne shardowanie, load balancing i replikacja, map-reduce). Przede wszystkich, MongoDB jest jedną z niewielu baz dokumentowych, co dramatycznie zmienia sposób naszej pracy z nią.</p>\n            <p>Używam MongoDB od pół roku produkcyjnie w projektach dla banku. Postaram się krótko przedstawić, jakie MongoDB ma feature\'y, po co i jak się z tego korzysta. Czasu jest mało, więc nie liczcie na szczegóły, a bardziej na informacje co MongoDB może wam dać i dlaczego warto się nią zainteresować. </p>\n            <h3>O prelegencie: Jakub Nabrdalik</h3>\n            <p>Solution Architect @ TouK. 10 lat Groovy, Java, C#, PHP | PostgreSQL, Oracle, MS SQL, MySQL i w końcu MongoDB. Nie znosi kiepskiego kodu, stąd sporą część życia zawodowego skupił na Test Driven Development, Domain Driven Design i Software Craftsmanship movement. Team leader i project manager, programista, analityk, etc. Bloguje na blog.solidcraft.eu.</p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
