buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>124 spotkanie WJUG</h4>\n            <h2>Java EE Portal Anno Domini 2013</h2>\n            <h3><a href="http://bdawidowicz.blogspot.com" target="_blank">Bolesław Dawidowicz</a></h3>\n            <p>Termin: 19.11.2013 godz. 18:00</p>\n            <p>Lokalizacja: MIMUW, sala 3180</p>\n            <h3>O prezentacji:</h3>\n            <p>Rok portali tak jak rok linuxa wielokrotnie się zbliżał jednak nigdy nie nastał. Portlety to jedna z najbardziej nierozumianych i niekochanych technologi w świecie Java EE. W projektach w których byłaby najbardziej przydatna zazwyczaj nigdy nie była rozważana. Tam gdzie została wdrożona często wystarczyłby zwykły serwer webowy… Wielu głosiło jej rychłą śmierć jednak z dużą dozą przekory wciąż bardzo dobrze się trzyma i aktywnie rozwija. Cały czas w określonej klasie zastosowań nie ma też dla niej żadnej dobrej alternatywy.</p>\n            <p>W czasie tej prezentacji *nie* nauczycie się pisać portletów a kodu będzie jak na lekarstwo. Dowiecie się za to jakie są mocne i słabe strony technologii portali. Zdobędziecie też potrzebną wiedzę aby trafnie ocenić jej przydatność w waszym projekcie. Odkryjecie także że portal portalowi nierówny oraz będziecie mieli możliwość zapoznania się w jakim kierunku obecnie podążają. Na koniec zastanowimy się także jaka jest ich przyszłość oraz jakie technologie oraz standardy widoczne na horyzoncie mogą je ostatecznie zastąpić.</p>\n            <h3>O prelegencie:</h3>\n            <p>Od 2005 roku współpracuje z firmą<a href="http://www.redhat.com/" target="_blank"> Red Hat</a> (dawniej JBoss). Od zawsze związany z oprogramowaniem OpenSource oraz preferuje pracę zdalną. Obecnie jako Platform Architect jest odpowiedzialny za produkt<a href="http://www.redhat.com/products/jbossenterprisemiddleware/portal/" target="_blank"> JBoss Portal Platform</a> oraz współkieruje projektem<a href="http://www.jboss.org/gatein" target="_blank"> GateIn Portal</a>. Współtwórca projektu<a href="http://www.picketlink.org/" target="_blank"> PicketLink</a>. Członek "Expert Group" w<a href="http://jcp.org/en/jsr/detail?id=351" target="_blank"> JSR 351</a> oraz<a href="http://www.jcp.org/en/jsr/detail?id=362" target="_blank"> JSR 362</a>. Niegdyś aktywny członek i jeden z liderów Warszawa JUG - obecnie w stanie spoczynku. Współorganizował konferencję<a href="http://www.confitura.pl/" target="_blank"> Javarsovia/Confitura</a> (edycję 2008) oraz<a href="http://warsjawa.pl/" target="_blank"> Warsjawa</a> w latach 2008, 2012 i 2013.</p>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/_vSoiXzKhWM" frameborder="0" allowfullscreen></iframe></p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
