buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>19 spotkanie WJUG</h4>\n            <h2>EJB 3.0 z JPA 1.0 w POPie (Pytania i Odpowiedzi z Przykładami)</h2>\n            <h3> <a href="http://www.jaceklaskowski.pl/" target="_blank">Jacek Laskowski</a></h3>\n            <p>Termin: 04.12.2007 godz. 18:30</p>\n            <p>Lokalizacja: MIMUW, sala 4420</p><strong>Materiały </strong>\n            <ul>\n              <li><a href="https://groups.google.com/forum/#!topic/warszawa-jug/rgEDjrgRpCM/" target="_blank">dyskusja</a></li>\n            </ul>\n            <h3>O prezentacji:</h3>\n            <p>Specyfikacja <a href="http://java.sun.com/products/ejb/" target="_blank">Enterprise JavaBeans 3.0 (EJB3)</a>, której integralną częścią jest <a href="http://java.sun.com/javaee/technologies/persistence.jsp" target="_blank">Java Persistence API (JPA)</a>, to jedna z kluczowych elementów specyfikacji Korporacyjnej Javy 5 (Java EE 5). Jeszcze do niedawna wielu z przyjemnością zapomniałoby całkowicie o istnieniu EJB zastępując ją alternatywnymi rozwiązaniami i dopiero czynny udział osób związanych z projektami otartymi, m.in. Hibernate, czy Spring Framework sprawił, że EJB3 stał się ciekawym rozwiązaniem, po które można sięgnąć z przyjemnością podczas tworzenia rozwiązań korporacyjnych opartych o platformę Java EE 5. Biorąc pod uwagę ścisłą integrację EJB3 z pozostałymi elementami Java EE 5, nie sposób nie korzystać z jego dobrodziejstw, a jest ich wiele, z czego na szczególną uwagę zasługują - deklaratywne określanie wykorzystania usług serwera aplikacji Java EE 5 jak bezpieczeństwo, transakcje, trwałość, utrzymywanie sesji, czy udostępnianie ziaren EJB jako usług sieciowych, a skończywszy na elementach AOP w postaci mechanizmów przechwytywania zdarzeń rozwojowych ziaren.</p>\n            <p>Spotkanie będzie prowadzone w formie warsztatu. Rozpoczniemy od stworzenia wszystkich typów ziaren EJB, następnie zostanie zaprezentowana integracja z warstwą servletów, po czym przejdziemy do mechanizmu przechwytywania zdarzeń (interceptorów), aby skończyć na sesji pytań i odpowiedzi, które sprawią, że pozostały czas spędzimy na dyskusji, czy w ogóle warto się zajmować EJB3, w kontekście istnienia technologicznie zaawansowanych rozwiązań alternatywnych (jeśli takowe w ogóle istnieją). Właśnie pojawiła się najnowsza wersja <a href="http://www.netbeans.org/" target="_blank">NetBeans IDE 6</a>, której ideą przewodnią było uproszczenie tworzenia aplikacji korporacyjnych w Javie, więc w połączeniu z serwerem GlassFish będzie to nasza platforma programistyczna. Spotkanie będzie kontynuacją doświadczenia polegającym na prowadzeniu prezentacji z minimalną porcją slajdów, gdzie motorem napędowym będą sami uczestnicy spotkania.</p>\n            <h3>O prelegencie:</h3>\n            <p> <a href="http://www.jaceklaskowski.pl/" target="_blank">Jacek Laskowski </a>zajmuje się Korporacyjną Javą od pierwszego dnia jej opublikowania. Jest członkiem zespołów rozwojowych m.in. Apache Geronimo, Apache OpenEJB. Zajmuje się rozpoznawaniem technologii upraszczających tworzenie aplikacji korporacyjnych z Java EE 5, a swoje spostrzeżenia publikuje w Notatniku Projektanta Java EE oraz na swoim Notatniku-Wiki. Jest założycielem i liderem Warszawskiej Grupy Użytkowników Javy (Warszawa JUG). Ideę dzielenia się wiedzą wprowadza w życie poprzez wystąpienia na konferencjach krajowych i zagranicznych. Służbowo związany z firmą IBM jako konsultant oprogramowania.</p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
